column6:
입장했는데 자리안내도 없고해서 사람들도 많은 2층 올라감 2층아줌마 1층가서 안내받고 오라해서 다시 내려감 1층여자 2층 마감해서 1층 앉으라함 (저녁8시,2층사람많음)옆테이블과 한칸씩 띠어서 중간에앉으니 옆손님쪽으로 몰아 앉으라고함;; 
무슨 손님을 가축몰이하듯이 대하는집. 다시는 안간다
고기맛도 명륜진사갈비맛수준;;(참고로 소갈비먹음)

맛있는데…사장님이 화나셨음..;;
혼잣말로 약간 욕도 하시고 그러길래
아~ 주방부터 홀까지 혼자하니까 바쁘셔서 그러구나 했는데
후기를 보니 원래 그런 분 같음ㅎㅎ;;
바쁘시면 파트타임 직원을 한명 더 쓰세요ㅠㅠ
불편해서 그렇지 맛은 있어요
